import React from 'react';

const date = new Date();
const year = date.getFullYear();

const Filter = props => (
  <div className="filter">
    <form onSubmit={props.getMovies}>
      <span> IMDB Rating: </span>
      <input className="form__input" type="number" min="1" max="10" name="imdb" />
      <span> Amazon Star Rating: </span>
      <input className="form__input" type="number" min="1" max="5" name="star_rating" />
      <span> Number of Amazon Reviews: </span>
      <input className="form__input" type="number" min="1" max="5" name="review" />
      <span> Year: </span>
      <input className="form__input year" type="number" min="1950" max={year} name="year" />
      <button className="form__button">Search</button>
    </form>
    <br/>
    <span>Displaying {props.movies.length} movies</span>
  </div>
);

export default Filter;
